func TestIsUnique(t *testing.T) {
	if allUnique("wangwang is a good boy", 0, 4) {
		t.Error("`wangw` should not be unique")
	}

	if !allUnique("picture", 0, 6) {
		t.Error("picture should be a unique string")
	}
}

func TestMaxSubStrLen(t *testing.T) {
	if lengthOfLongestSubstring("abcabcbb") != 3 {
		t.Error("expected 3 but got", lengthOfLongestSubstring("abcabcbb"))
	}

	if lengthOfLongestSubstring("bbbbb") != 1 {
		t.Error("should be 1 but got", lengthOfLongestSubstring("bbbbb"))
	}

	if lengthOfLongestSubstring("pwwkew") != 3 {
		t.Error("should be 3 but got", lengthOfLongestSubstring("pwwkew"))
	}

	fmt.Println(lengthOfLongestSubstring(longStr))

}

